import user from "./userReducer";
import pilote from "./piloteReducer";
import circuit from "./circuitReducer";
import ecurie from "./ecurieReducer";
import notification from "./notificationReducer";

// Export automatique de tous les selecteurs
export * from "./userReducer";
export * from "./piloteReducer";
export * from "./circuitReducer";
export * from "./ecurieReducer";
export * from "./notificationReducer";

export default {
  user,
  pilote,
  circuit,
  ecurie,
  notification
};
